import React from 'react';
import {NavLink} from 'react-router-dom';
import aboutusimg from '../Images/aboutus.avif'
import Same from './Same'

const About=()=>{
    return(
        <>
        <Same
        title="Know More About Us"
        text="Welcome to our course app! We are a team of passionate developers and educators dedicated to helping you master the latest skills in web development, front-end design, and full-stack development. Our courses are carefully crafted to provide comprehensive learning experiences that cater to students of all levels, from beginners to advanced learners.

        At our course app, we believe that learning should be fun and accessible to everyone. That's why we offer a range of resources, including interactive video lessons, coding exercises, and quizzes, to help you learn at your own pace and in your own way. Our team is committed to providing you with the support and guidance you need to achieve your goals, whether you are looking to start a new career in tech or simply want to enhance your coding skills.

        We are proud to offer a variety of courses to suit your needs, including Web Development, Front End Design, and Full Stack Development. With our expert instructors and cutting-edge curriculum, you can be confident that you are learning from the best in the industry.

        Don't wait any longer to start your coding journey. Join us today and discover the exciting world of web development!

        Click here to check out our courses: https://dummylink.com/courses"
        imgsrc={aboutusimg}
        btn="Know More"
    />
        </>
    )
}
export default About;
